	}
	addCard = ()=>{
		alert("you died")
		return console.log("ubungo")
	}

	render(){

		return(
			<div>
				<h1>Yolo</h1>
				<h2>Herro</h2>
				<MagicCards addCard={this.addCard} />
			</div>
		)
	}
}
